INSERT INTO `chouti` VALUES ('751', '【湖南一对夫妻为争夺子女抚养权 致两儿子死亡】湖南常德桃源县，李振东与妻子因离婚争夺子女抚养权问题发生冲突，李振东顺手操起室内一把锄头砸向妻子及其两个小孩，导致妻子受伤，大儿子周某死亡，小儿子周某某送医途中死亡。嫌犯李振东已被抓获。', '暂无', '3', '11', '网易新闻客户端', '12分钟前', 'https://www.thepaper.cn/newsDetail_forward_3271322', 'https://img3.chouti.com/CHOUTI_20190408/DDE3D16031B14AC69B6963A862132F96_W218H218=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('752', '【悲观一点讲，老挝生态会比我们的先崩坏】云豹是在老挝北部最受关注的物种。当地的土话管云豹叫“小老虎”，真正的老虎叫“大老虎”。为什么大家不关注大老虎呢？因为没了。老挝北部，是云贵高原的自然延伸。我们那边已经消失了的动物，这里可能找得到。保住了老挝的这片森林，动物总有一天会回到我们的土地上。', '暂无', '9', '6', '花落成蚀', '22分钟前', 'https://mp.weixin.qq.com/s/Yloq9FnQzkrHvPKlnoMJLQ', 'https://img3.chouti.com/CHOUTI_20190408/9BE0D2E92DE145E197D17394CBC30319_W200H200=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('753', '【秀场男孩：女强男弱的行业里，男人们会遭遇什么？】当刘雯、奚梦瑶等女超模持续吸引公众目光，男模却鲜少拥有声名。2011年《智族GQ Style》创刊封面，在构图中只留下一个侧脸轮廓的，就是傅正刚。“没有脸”让他耿耿于怀。后来杂志举办创刊派对，他也拒绝参加。', '暂无', '9', '2', '甄冬持', '28分钟前', 'https://mp.weixin.qq.com/s/pso00fmTywNf6yMnfo7-ug', 'https://img3.chouti.com/CHOUTI_20190408/5A4E89504A0E4C748C069A4BE08EF135_W200H200=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('754', '【微软HoloLens 2美军定制版体验：感觉像现实版COD】CNBC近日受到美国军方邀请体验了代号为“IVAS”的定制版HoloLens 2眼镜，记者描述称，戴上IVAS之后，使用者可以透过一块玻璃板看到包括3D图像、信息情报、本人的位置在内的等待信息，甚至能定位队友或者已知敌人的位置，感觉就像是“真实的《使命召唤》游戏”。', '暂无', '8', '4', '肉粽酿米酒', '34分钟前', 'https://www.leiphone.com/news/201904/ayGrXrck3l8Xk6Fu.html', 'https://img3.chouti.com/CHOUTI_20190408/3748ADD095A04051885C5A9FF78BFE69_W247H247=C120x120.jpg?quality=80');
