INSERT INTO `chouti` VALUES ('759', '【微信一下，寻医购药？】“微信支付”页面将增加“医疗健康”入口，隶属于腾讯服务版块（非第三方服务），目前该入口仍处于灰度测试阶段。医疗健康将成为腾讯服务版块第十个应用，该入口接入的是“腾讯健康”小程序，由腾讯医疗健康事业部负责运营，提供医院挂号、体检预约、报告查询、医生咨询、线上药房等轻医疗服务。', '暂无', '8', '6', '钛媒体', '1小时5分钟前', 'http://www.tmtpost.com/3844928.html', 'https://img3.chouti.com/CHOUTI_20190408/0C41BA0FC6F24505877FB262FC6E765A_W686H686=C120x120.jpg?quality=80');
