INSERT INTO `chouti` VALUES ('765', '东方之珠的守夜人：香港警队的昨天、今天与明日（上）', '\n（本文首发战甲军品资料网）写在前面：“警察的传奇也是人类的传奇”，曾有人这么写道。的确，对于现代社会中的普通人来说，警察是一个既陌生又熟悉的名词。1829年，在罗伯特·比尔的努力下，英国通过了《大伦敦警察法》，从而建立了第一支现代意义...\n', '11', '3', '机核网', '1小时41分钟前', 'https://www.gcores.com/articles/108287', 'https://img3.chouti.com/CHOUTI_20190408/3C76CDD600A74C30BB1DE3B844C7C388_W397H397=C120x120.jpg?quality=80');
INSERT INTO `chouti` VALUES ('766', '【十七年十亿：「房神」背影中的淘金传奇】欧成效意识到，他曾经能大放异彩的时代已经提早奏响了尾声。当然，对更多普通人来说，这个黄金时代其实从未来过，也无谈离去。其余的入场玩家却并不承认这是一个即将关闭的赌局，他们身后还有越来越多的淘金者在奔来的道路上，似乎属于他们的财富奇遇才刚刚开始，也永不会结束。', '暂无', '18', '3', 'Cog', '1小时47分钟前', 'https://mp.weixin.qq.com/s/v0cLIkyUegTRosKoXPGnvg', 'https://img3.chouti.com/CHOUTI_20190408/19484C3CD25C43AD9545477E3C5AC06C_W720H720=C120x120.jpg?quality=80');
INSERT INTO `chouti` VALUES ('767', '【赌命生子产妇离世：最后的时间在反思、自责、后悔】我看她之前写的东西，发现可能是手术后的这段经历让她没那么强势，让她感受到事情有一点在往自己不可控的方向发展。她也有跟我说过，其实她后悔了。我觉得还是死者为大，人都已经走了，对吧？而且为自己当初疯狂的行为，已经付出惨痛代价了，就让逝者安息，不要折腾了。', '暂无', '8', '36', '院长', '1小时53分钟前', 'https://www.sohu.com/a/306415864_658673', 'https://img3.chouti.com/CHOUTI_20190408/3742404B7E6247D88B3D865CC575EBBB_W300H300=C120x120.jpeg?quality=80');
INSERT INTO `chouti` VALUES ('768', '南非克鲁格国家公园表示，2日，一名涉嫌在园内非法偷猎犀牛角的嫌疑人被大象踩死，其同伴者将死讯告知死者家属后，家属通知园方，搜救队随即展开搜索，试图寻找死者遗体，直到4日找到一个人类骨头和一条裤子，园方向死者家属致以哀悼，同时提醒“非法和自行徒步进入克鲁格国家公园是不明智的。”', '暂无', '24', '15', '克林姆林宫', '1小时59分钟前', 'http://sputniknews.cn/society/201904071028129853/', 'https://img3.chouti.com/CHOUTI_20190408/842EB2021FCF4EAC83857F86A09CBB36_W536H536=C120x120.jpg?quality=80');
INSERT INTO `chouti` VALUES ('769', '【抖音国际版风靡日本 十几岁的中学生是主力】与中国抖音多样化的内容不同，受用户群体影响，TikTok 呈现出满屏“漂亮小哥哥小姐姐”的状态。“对口型”和“做鬼脸”是最受投稿者欢迎的两个题材。这两个题材不仅新奇搞怪，还可以尽情展现自己可爱的风情。', '\n2018 年，国际版抖音 TikTok 席卷日本各类以年轻人为调查对象的流行语排行榜。Mynavi 实验室“10 余岁女生特选趋势榜单”中，TikTok 获“流行物排行”第二名，仅次于奶茶。另外，此榜单“流行事排行”第 6 位的“俘虏...\n', '13', '14', '好奇心日报', '2小时5分钟前', 'http://www.qdaily.com/articles/61931.html?source=chouti', 'https://img3.chouti.com/CHOUTI_20190408/70DFA4D9958D4447AD10A941E2669F41_W905H905=C120x120.jpg?quality=80');
