INSERT INTO `chouti` VALUES ('772', '【央行主管媒体：切忌炒作楼市“小阳春”】央行主管的金融时报刊文称，如果只关注单一月份异动，就过度炒作，甚至有相关从业人员再次鼓吹“抢跑入场”和“飞涨论”，显然并不可取，而这种舆论推热的楼市升温可能在一段时间内构成“刚需压力”，对市场平稳健康发展无益。', '暂无', '23', '13', '华尔街见闻', '2小时23分钟前', 'http://wallstreetcn.com/articles/3507494', 'https://img3.chouti.com/CHOUTI_20190408/2084A774905143E9B60A751F6AD261A6_W530H530=C120x120.jpg?quality=80');
INSERT INTO `chouti` VALUES ('773', '4月3号发表于柳叶刀的一篇论文发现各个国家饮食都没有做到特别健康，日本算是最好的几个大国之一，但是仍然盐摄入过量，中国、泰国同样盐吃得太多，而且文中两次提到了中国，显示饮食不均衡导致的癌症、心血管疾病风险增加在中国情况最严峻。', '暂无', '31', '62', '营养师顾中一', '2小时29分钟前', 'https://media.weibo.cn/article?id=2309404358487902695360', 'https://img3.chouti.com/CHOUTI_20190408/26F7047233F645D79E3B31869C782A6C_W1699H1080=C120x120.jpg?quality=80');
INSERT INTO `chouti` VALUES ('774', '【网曝京东取消快递员底薪 官方回应】网传京东将取消旗下快递员的底薪，另外将增加快递收件任务，揽件将计入绩效，快递员收入将全凭绩效。对此，京东物流回应称，原来的薪酬结构已经不适应新的模式，无法对绩效优异的员工体现出足够的激励。因此，在部分地区试点将底薪转变成更有激励性的业务提成。', '暂无', '19', '44', 'cnbeta', '2小时41分钟前', 'https://tech.sina.com.cn/i/2019-04-07/doc-ihvhiqax0694988.shtml', 'https://img3.chouti.com/img_1554680738962=C120x120.jpg?quality=80');
