INSERT INTO `chouti` VALUES ('780', '艺术家Marc Quinn 1964年出生于伦敦，是英国当代艺术的标志性人物之一。他最著名的作品也是最具有争议性的，始于1991年的系列创作《自己》。每隔5年，他将自己的血液冷冻倒模成自己的头像，并冷冻保存。据称，1991年那件被收藏家以1万3千英镑购得的头像，已经因为装修工人误拔掉电源而化作了一滩血水。​​​', '暂无', '22', '13', '尖峰视界', '3小时17分钟前', 'http://dig.chouti.com/pic/show?nid=7bdf0bcb7b7d6622baa81d1e02c2827e&lid=25535886', 'https://img3.chouti.com/CHOUTI_20190408/F8E3C1AFAF004A84B44909304B7A4653_W500H580=C120x120.jpg?quality=80');
INSERT INTO `chouti` VALUES ('781', '【科创板承销保荐费率多在6%～8%】至4月4日，科创板受理企业已达50家，上市业务被24家保荐机构包揽。据悉，大部分科创板项目的承销保荐费率在6%～8%之间，视不同情况，个别项目的费率会低至3%或高于10%。', '暂无', '15', '2', '证券之星官方微博', '3小时23分钟前', 'https://finance.sina.com.cn/roll/2019-04-08/doc-ihvhiewr3914279.shtml', 'https://img3.chouti.com/CHOUTI_20190408/5822B6DFD7D44D54BA1DC41B8D42B8A3_W1077H1077.958=C120x120.jpg?quality=80');
INSERT INTO `chouti` VALUES ('782', '【“我钱不多”董明珠：到底有多少钱？她能入主格力吗？】目前，董明珠持有格力电器股份4448.85万股，按停牌前47.21元股价计算，董明珠股票资产21亿元；1996年格力电器上市，至2018年中期，董明珠累计获得税前分红2.53亿元；据此计算，1996年以来，董明珠合计资产约24.03亿元。', '暂无', '27', '16', '腾讯科技', '3小时33分钟前', 'http://tech.qq.com/a/20190408/000323.htm', 'https://img3.chouti.com/CHOUTI_20190408/CFE856A42643483EB851348B1942D73F_W428H428=C120x120.jpg?quality=80');
