INSERT INTO `chouti` VALUES ('784', '【论航拍，没什么能比得过鸽子】早在19世纪末，人们就想手拿相机飞到天上来一张航拍作品，不过受科技水平所限，航拍的成本和难度都极高。过了几年，一名叫做尤利乌斯的德国药剂师突发奇想：“为什么不让鸽子们带着相机在天上拍照呢”？', '\n鸽子们自己都没想到，它们如今已进化成人类三本质之一，成就了铺天盖地的表情包和流行语，作为网络meme的顶流，实属鸽中鸽，听起来很有排面。但是话说回来，人类历史中的鸽子地位从来没低过。殷墟中出土过玉制鸽子，《礼记》里讲过养鸽子，宋朝的鸽...\n', '26', '4', '机核网', '3小时43分钟前', 'https://www.gcores.com/articles/108167', 'https://img3.chouti.com/CHOUTI_20190407/292297CFFAFF4676B0B1708F848303BE_W200H200=C120x120.png?quality=80');
