INSERT INTO `chouti` VALUES ('790', '【囧雪诺被龙妈、Samwell、夜王和老婆火吻拷问权游大结局】“囧雪”基特·哈灵顿主持SNL，《权力的游戏》好友纷纷来帮忙。艾米莉亚·克拉克想知道“龙妈”结局究竟如何，山姆担心剧终之后友情走到尽头。基特老婆萝斯·莱斯利才不关心GoT大结局，更实际的问题是，两人以后如何挣钱养家？', '暂无', '53', '20', '璀璨的摧残', '5小时23分钟前', 'https://weibo.com/tv/v/HoyJ2aln0?fid=1034:4358532779417678', 'https://img3.chouti.com/CHOUTI_20190407/703ED08668F84BAFBB062C109804437C_W200H200=C120x120.png?quality=80');
