INSERT INTO `chouti` VALUES ('792', '【朱雨玲亚洲杯三连冠】今天的乒乓球亚洲杯上，朱雨玲以4:2战胜队友陈梦，东京奥运周期第三次捧得亚洲杯冠军，此前朱雨玲被排除在世锦赛单打之外，作为世界第二却无法参赛，而第五个名额被主力成绩最差的刘诗雯占据，被球迷质疑刘国梁搞小团体排挤没有在之前罢赛中为他战队的队员，争议很大。此次媒体也问及朱雨玲此事。', '暂无', '35', '16', 'feather_l', '7小时23分钟前', 'http://dig.chouti.com/pic/show?nid=9ea36b8f6cde038a599aa0c6910a23bc&lid=25533271', 'https://img3.chouti.com/CHOUTI_20190407/AA8DAD40F2AD4B74B3D12585BC231DD8_W200H200=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('793', '【《BanG Dream! 》获19年首批进口版号后，为什么他们如此雀跃？】《BanG Dream!》手游是一款由株式会社Craft Egg开发的下落式音乐游戏。在经过两年的良好发展，该游戏目前全球范围内的玩家数量已经突破了1000万人。“邦邦人”，即《BanG Dream!》的粉丝自称。', '\n一切都源于粉丝的高粘度\n', '22', '4', 'ACGx', '8小时23分钟前', 'https://mp.weixin.qq.com/s/1l8UDObZiAFa_R2S70a9uQ', 'https://img3.chouti.com/CHOUTI_20190407/5B0FABB6F1D94034ADF67499BE0D9339_W200H200=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('794', '【The Grand Tour S03E13 这蒙古特辑也太厉害了 】@帕林马哲理：三个老头硬是自己组装车过了那么多地形，还完全没抛锚//杰里米：“我很高兴许多人喜欢蒙古特辑（该集在IMDB上的评分为9.8），但是我更对下周的第三季最后一集感到自豪。我在那集中注入了灵魂与心血。”​​​', '暂无', '104', '17', '这你怎么看', '9小时23分钟前', 'https://www.bilibili.com/video/av48366014', 'https://img3.chouti.com/CHOUTI_20190407/131152ABE9FF4B3586E0A52121374E97_W200H200=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('795', '【暴利的“网上麻将馆”，遇到了大麻烦】与全国性网游相比，地方棋牌的游戏规则千差万别。合平资产投资总监程晓虎曾撰文称，经过调研和估算发现，全国661个县市，每个县市至少有两款以上的棋牌游戏版本，单单湖南省，把服务器托管在阿里云的棋牌游戏就多达五千多家，而浙江一个地市有备案的棋牌游戏公司，多达四百多家。', '暂无', '39', '21', '南方周末', '10小时23分钟前', 'https://mp.weixin.qq.com/s/FT1IJ-my4LpKKDQV80VvZA', 'https://img3.chouti.com/CHOUTI_20190407/C79C0BE4824C4C30B5D5811565DB5F8C_W200H200=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('796', '【醉驾男子“因祸得福” ，体检查出尿毒症感谢民警：你们给了我第二次生命】近日，驾驶人胡某因醉驾被民警查获。民警在依法对其采取措施进行体检过程中发现，胡某已到尿毒症早期。胡某得知情况后庆幸不已，对民警感谢万分，称“你们交警给了我第二次生命”。', '暂无', '55', '17', '观察者', '10小时53分钟前', 'https://weibo.com/tv/v/Ho4rmzXLE?fid=1034:4357368138640910', 'https://img3.chouti.com/CHOUTI_20190407/A7F55967639240DCB7E2807E1DBE897A_W200H200=C120x120.png?quality=80');
