INSERT INTO `chouti` VALUES ('799', '【民营火箭，难上九霄】航天探索从来不是一帆风顺。中国四大发射基地酒泉、太原、西昌、文昌，都见证过眼泪。早年发射任务与国家荣辱绑定，牵动着国人神经。出现重大失利后，研发人员通常要承受巨大压力，有人甚至“一夜白头”；民营航天起步后，人们看待成败则更为理性。', '暂无', '39', '7', 'AI财经社', '12小时23分钟前', 'https://mp.weixin.qq.com/s/C3sISSIu6Qhk9q_fnGHB-g', 'https://img3.chouti.com/CHOUTI_20190407/F36711C55DCB4F9885B5EF600CF5A4C4_W200H200=C120x120.png?quality=80');
