INSERT INTO `chouti` VALUES ('806', '【德国工业4.0上空飘来了美国的云】很长时间以来在德国对云计算有很多质疑的声音，很多企业不愿意把自己的数据上传到服务提供商的计算中心，而现在的趋势发生了很大的改变。“亚马逊及微软带来他们数字化方面的能力，而宝马与大众对工业制造有丰富的经验。”未来是工业互联网，还是互联网工业尚未可知。', '暂无', '30', '17', '网线个边大件事', '14小时8分钟前', 'https://mp.weixin.qq.com/s/yH0QhCrlNA9fXO6-jrgUbw', 'https://img3.chouti.com/CHOUTI_20190407/80E49EF430BC4E769918FFA46EEBD4CA_W200H200=C120x120.png?quality=80');
