INSERT INTO `chouti` VALUES ('821', '《镜像双胞胎》第一季的剧情简介 · · · · · · 故事讲述成为了罪犯的哥哥葛城勇吾以及成为了警视厅搜查一课刑警的弟弟圭吾。弟弟因在杀人未遂事件中被测出了与嫌疑人的DNA跟自己完全一样而遭到逮捕。此时他想起了在20年前因被诱拐而下落不明的双胞胎哥哥。 （我们终于有真正的文化输出，优秀作品也被别人抄袭了；）', '暂无', '52', '18', 'zycat', '17小时43分钟前', 'https://dig.chouti.com/pic/show?nid=5e916094bb6e6f4abab3a29ef7ec78c5&lid=25531391', 'https://img3.chouti.com/CHOUTI_20190407/7BBD9DE55F4D40ABB01FE13C355F6F75_W463H327=C120x120.jpg?quality=80');
