INSERT INTO `chouti` VALUES ('825', '【我为什么说“影视行业不存在”】确实存在一个“电影行业”，也确实存在一个“剧集行业”，它们都是规模很大、水很深的行业（为了简化问题，在此暂不讨论综艺行业）。然而，它们的内部逻辑差异过大，以至于我们无法简单粗暴地将其统称为“影视行业”。', '\n任何娱乐内容的制作者，都需要与观众直接接触\n', '36', '4', '神奇的耳朵', '18小时23分钟前', 'https://mp.weixin.qq.com/s/tIV7IaQuRwRk5BeOg86LjQ', 'https://img3.chouti.com/CHOUTI_20190407/8C1D3191F3AD40ED9E6C7067BDFAA197_W590H590=C120x120.JPG?quality=80');
