INSERT INTO `chouti` VALUES ('828', '【美国西北大学研究发现：贫穷会在基因留下印记】近期，美国西北大学发现，贫穷可以嵌入基因组的大片区域，会在人类基因组中近10%的基因上留下印记。研究表明，较低的社会经济地位与DNA甲基化水平有关，DNA甲基化在后天形成，是能够潜在影响基因表达的遗传印记，不过，基因会记住贫穷的机制，还没有被揭晓。', '暂无', '36', '33', '梨视频', '18小时53分钟前', 'https://www.pearvideo.com/video_1539566', 'https://img3.chouti.com/CHOUTI_20190407/6234AEE364344B969D72F09597DF167A_W200H200=C120x120.png?quality=80');
