INSERT INTO `chouti` VALUES ('841', '【“无领导的扁平架构”在新经济时代成了流行，但这种理念其实站不住脚】“权力高度下放、员工赋能授权”为原有内核披上新的外衣。对 300 家世界五百强企业进行了为期 14 年的观察分析，最终发现企业组织架构越来越扁平，但这样做的目的却是为了将权力集中到高管手中，而非对基层员工赋能授权。', '暂无', '44', '22', '这你怎么看', '21小时3分钟前', 'http://www.qdaily.com/articles/62504.html', 'https://img3.chouti.com/CHOUTI_20190407/1E07DA9BA5CD4A76B09E436706B56956_W200H200=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('842', '《隻狼》中的佛教艺术大盘点', '\n在正式开始之前，我不得不提到一个很重要的问题：建模的重复利用。先不说满大街都是的地藏像，光是下图中这尊金光闪闪的菩萨，就出现在了森林里的老和尚NPC旁边，仙峰寺千手观音坐像的附近，还有长手仙云所在的小房间里，幻廊吹灭灯火，杀眼观猴的那...\n', '36', '4', '机核网', '21小时13分钟前', 'https://www.gcores.com/articles/108008', 'https://img3.chouti.com/CHOUTI_20190407/31F7C9191C66498E946FA8E7C4BE0A9B_W200H200=C120x120.png?quality=80');
