INSERT INTO `chouti` VALUES ('845', '【时隔 25 年再访 Linus：流量时代的“技术大师”】我们在争论中用“Talk is cheap, Show me the code”来反驳别人，同时也热衷于看媒体群嘲 Linus。Linus 表示他讨厌媒体，说他的言论在社交软件和媒体中不断分享和夸大，匿名的方式更是加重了网络暴力，“25 年前大家可不是这样对待我的”。', '暂无', '18', '6', '网线个边大件事', '21小时43分钟前', 'https://mp.weixin.qq.com/s/OcyOIMIA0WBJPoPqEOzJkQ', 'https://img3.chouti.com/CHOUTI_20190407/9510BD8E15BE4A17BE6D0B19B80C8A11_W200H200=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('846', '北京海淀区附近发生2.9级地震，震源深度17千米', '\n4月07日13时25分在北京海淀区（北纬40.08度，东经116.23度）发生2.9级地震，震源深度17千米。\n', '28', '45', '神奇的耳朵', '21小时45分钟前', 'https://www.thepaper.cn/newsDetail_forward_3269445', 'https://img3.chouti.com/CHOUTI_20190407/7F957470CAC843F8BE59BAA9090AD6C7_W200H200=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('847', '【英国护照去掉欧盟 ：脱欧尚未成功，护照已经改版】英内政部表示，本以为上月底英国就会脱离欧盟，于是发行了最顶行取消“欧盟”字样的新护照……结果还是没脱成。在旧版护照存货用完之前，有人还会收到旧版本的护照。​​​有收到新护照的民众表示，只要英国仍是欧盟成员国，护照的设计就不应该改变。', '暂无', '21', '3', '奇曲揍敌客', '21小时53分钟前', 'http://world.huanqiu.com/article/2019-04/14677685.html', 'https://img3.chouti.com/CHOUTI_20190407/5FB7DDE5391E4BEF983D79BE6CF6F4EF_W200H200=C120x120.png?quality=80');
