INSERT INTO `chouti` VALUES ('851', '【尘卷风掀翻蹦蹦床致2死，一摊主家属承认蹦蹦床前部未固定】3月31日，河南虞城县田庙乡万亩果园梨花节突发尘卷风，导致2名儿童死亡、1名儿童重伤，17名儿童和2名成年人轻伤。目前，虞城正调查原因。出事的东侧蹦蹦床摊主的父亲承认，因为蹦蹦床摊位在水泥地上，只后面固定了四处，栓在梨树上，前面两个角未固定。', '暂无', '39', '14', '奇犽揍敌客', '22小时33分钟前', 'https://www.thepaper.cn/newsDetail_forward_3268435', 'https://img3.chouti.com/CHOUTI_20190407/4310BA0F1BB846AE82A101FD462D746E_W200H200=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('852', '【全球首富贝索斯离婚第二天 出轨对象女主播宣布离婚】4日，全球首富贝索斯正式和前妻达成离婚协议。仅第二天，其出轨对象女主播桑切斯也宣布和丈夫提交了离婚申请书。1月，贝索斯被曝婚内出轨已婚女主播，随后宣布和前妻麦肯齐离婚。', '暂无', '31', '28', 'cnbeta', '22小时43分钟前', 'https://www.pearvideo.com/video_1539453', 'https://img3.chouti.com/CHOUTI_20190407/F895765ABC964DB9924AC64415DF4849_W200H200=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('853', '【程序员创建955.WLB不加班公司名单，GitHub周榜第二，标星过万】所谓955，就是每天9点上班，下午5点下班，每周工作5天时间。而WLB，就是Work-Life Balance即工作生活平衡。955.WLB，主要用来统计哪些公司不加班。', '暂无', '63', '64', '巴颜格日顺', '22小时53分钟前', 'https://mp.weixin.qq.com/s/wj7eOnaGquUooGzB2R9Wqw', 'https://img3.chouti.com/CHOUTI_20190407/FF26224E2E0A48788BA3AA3D419D9382_W200H200=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('854', '【从麦当劳到金拱门：中信做对了什么？】于1992年开业的王府井大街麦当劳店，曾是地球上最大的麦当劳单体店面。2019年，它依然是这条街上的醒目地标，只是“麦当劳叔叔”不再那么显眼。这里已悄然撤下了原来红黄主色调的装修布置，取而代之的是以阳光黄为主的现代简约风设计。', '暂无', '36', '14', '这你怎么看', '23小时3分钟前', 'https://mp.weixin.qq.com/s/amu8Bc2RsX1NiyxAgvDyUA', 'https://img3.chouti.com/CHOUTI_20190407/FEFA71EBAC534906B7E844D92A55C010_W200H200=C120x120.png?quality=80');
