INSERT INTO `chouti` VALUES ('860', '【段子】\n												\n												\n												@张潇雨: 我一直认为的个人成长与人生选择过程中的三个悖论：18岁在对学科与知识一无所知的时候就被要求选择自己的专业；22-25岁在对商业世界运行规则毫无概念的时候就被要求选择工作方向；25-28岁在对自己和人际关系一知半解的情况下就被要求确定长期伴侣；这样想来，其实人生出问题是一个大概率事件。', '暂无', '481', '141', 'kokomomo', '23小时54分钟前', '/link/25526076', 'https://img3.chouti.com/CHOUTI_20190407/2BCA1CABA0B14B83BED53C5E2FA1CEF2_W200H200=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('861', '【丁香医生曾鼎：我做的报道里，像权健这样有一点推动作用的，只占了很少一部分】稿子发出来前，我做好了因为这篇稿子可能给公司惹上麻烦的准备，但就是没做好权健会倒掉的准备。这篇稿子出来以后影响很大，有很多人在网上打听作者的来路，还有人觉得丁香医生是不是事前得到了什么政府部门的授意，所以后续处理才这么快。', '暂无', '68', '20', '甄冬持', '1天1小时前', 'https://mp.weixin.qq.com/s/QXu5GGz4LQPaf5G1iY_kaA', 'https://img3.chouti.com/CHOUTI_20190407/7D8208B5374B419195CE6F0DCB9B6261_W200H200=C120x120.png?quality=80');
