INSERT INTO `chouti` VALUES ('863', '【SpaceX去年一箭发射64星，19颗已经失踪了】大约50多颗卫星在外观上看起来都是一模一样的，每一颗卫星采用了行业所称的“立方体卫星”模式（CubeSat），体积大约为一个麦片包装盒大小。结果是一大群几乎完全相同的航天器，导致地面人员和技术很难分辨出来。', '\nSpaceX去年一箭发射64星 19颗已经失踪了\n', '21', '14', '腾讯科技', '1天1小时前', 'http://tech.qq.com/a/20190407/001894.htm', 'https://img3.chouti.com/img_1554602412364=C120x120.jpg?quality=80');
