INSERT INTO `chouti` VALUES ('885', '【亲历战争余烬】《三联生活周刊》主笔刘怡现场观摩了库尔德人围攻is最后据点巴古兹镇的军事行动，在他看来，库尔德式攻城谈不上多少指挥艺术：通常是先包围城镇，通过喊话将平民及伤员疏散出来，之后呼叫美军进行饱和轰炸，最后士兵入城进行巷战。这类战斗往往持续时间极长，让他想起18世纪的那些战争。', '暂无', '35', '21', '实时报', '1天6小时前', 'https://www.ximalaya.com/renwen/12817863/173928175', 'https://img3.chouti.com/CHOUTI_20190407/989C84A974C842608DC5C52A2190FD84_W262H262=C120x120.jpg?quality=80');
