INSERT INTO `chouti` VALUES ('888', '60 万中老年人闭门不出，“宅”不再只是日本年轻人的问题', '\n对该年龄组的第一次官方调查显示，日本大约有 61.3 万名年龄在 40 到 64 岁之间的人被认为属于“宅”——数量甚至超过了 15 到 39 岁这个年龄段。卫生劳动和福利部将“宅”官方定义为在家中至少连续六个月，未被隔离、不上学或工...\n', '34', '14', '好奇心日报', '1天9小时前', 'http://www.qdaily.com/articles/62641.html?source=chouti', 'https://img3.chouti.com/CHOUTI_20190407/4830D95DA08F477BBA15EB41BD67F6DB_W197H197=C120x120.jpg?quality=80');
