INSERT INTO `chouti` VALUES ('891', '台湾资深音乐制作人阿怪（陈志翰）因病去世，年仅45岁。他曾为张惠妹、陶晶莹、萧淑慎、曾宝仪、范逸臣、萧敬腾、古巨基、苏永康等众多知名歌手填词作曲。代表作品包括张惠妹的《牵手》《给我感觉》《三天三夜》。他还是一位程序员，大学念的数学系。', '暂无', '71', '28', 'Cog', '1天11小时前', 'http://www.ituring.com.cn/article/35272?from=chouti', 'https://img3.chouti.com/CHOUTI_20190407/0FE5D84CD2EE41598C397B3AC02678F8_W176H176=C120x120.jpg?quality=80');
