INSERT INTO `chouti` VALUES ('893', '【美国科技巨头的唯一好消息：股价涨回历史高点】利润正在以惊人的速度萎缩；估值泡沫正在重新膨胀；半导体订单大幅下滑；用于支持云计算的基础设施支出也在减少；政界人士还在鼓吹分拆这些巨头…然而，人们对股价的依赖并没有消失。自圣诞节以来，这些科技股上涨超过30%。', '\n美国科技巨头的唯一好消息：股价涨回历史高点\n', '28', '9', '观察者', '1天12小时前', 'https://www.guancha.cn/ChanJing/2019_04_06_496602.shtml', 'https://img3.chouti.com/CHOUTI_20190406/5FA9D616C5BE4E9B8E593938040EF0F1_W184H184=C120x120.jpg?quality=80');
