INSERT INTO `chouti` VALUES ('918', '【木里火灾第31位遇难者：卧室床头满箱药，老父尚不知儿去世】林场条件艰苦，员工只能分到两个房间，一间作为客厅、厨房，一间作为卧室。在这个清贫的员工宿舍，客厅、厨房和洗漱台共享十多平米的空间，卧室床头放着一箱药物。一位同事说，王慧蓉有严重的颈椎病，3月31日上山扑火前一周，还去医院住过院。', '\n4月4日晚，王慧蓉的妻子强忍悲伤，和80多岁的王父通了电话，为了让老人安心，王慧蓉对王父说：“我们会弄好的。”何姓同事和在场的其他人，听到通话内容时已泣不成声。\n', '27', '20', 'royalflame', '1天18小时前', 'https://www.thepaper.cn/newsDetail_forward_3268256', 'https://img3.chouti.com/CHOUTI_20190406/31207B9DFEA74A1888B2BFE96D6063CA_W200H200=C120x120.png?quality=80');
