INSERT INTO `chouti` VALUES ('935', '【福建一培训机构否认聘台籍问题教师 该人被指曾涉诱奸案】台湾作家林奕含自杀，教师陈星被指涉诱奸。近日网友曝光该教师福建授课照片。校方回应，叫陈艺的教师曾来交流，并未任职授课。福州市教育局称正在调查。', '\n诱奸女作家的台湾教师疑似来大陆工作 福州教育局：已展开调查\n', '35', '10', '观察者', '1天21小时前', 'https://www.guancha.cn/politics/2019_04_06_496556.shtml', 'https://img3.chouti.com/CHOUTI_20190406/3FE00CDB588E4A9FBCEFC8810F632284_W477H477=C120x120.jpg?quality=80');
INSERT INTO `chouti` VALUES ('936', '【在旧金山城市之光书店创始人诞辰百年之际，拜访他的城市】在同等规模下，城市之光应该是美国最好的书店了。它不像纽约曼哈顿的斯特兰德书店和伯克利市的书店 Moe’s Books 那样大而杂乱，而是摆满了各种各样严肃的世界文学作品——没有装饰性的小物件，没有精致的书签，没有蜡烛，完全是一个柏拉图式的理想书店。', '暂无', '18', '4', 'royalflame', '1天21小时前', 'https://www.qdaily.com/articles/62599.html', 'https://img3.chouti.com/CHOUTI_20190406/F54CA0C1258543EFB3E4FB1AD627A5D5_W200H200=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('937', '马斯克发推文称，Model 3后视镜上方有一个内置摄像头，可以让这款车最终成为一辆自动驾驶出租车。“当我们开始与Uber/Lyft竞争时，它就在那里。”他计划允许特斯拉车主将汽车当作无人驾驶出租车使用，从而赚取额外的利润，需要解决的“只是完成软件和通过监管审批的问题”。', '\n特斯拉Model 3装车内摄像头 马斯克解释为造自动化出租车\n', '22', '15', '腾讯科技', '1天21小时前', 'http://tech.qq.com/a/20190406/002181.htm', 'https://img3.chouti.com/img_1554518715839=C120x120.jpg?quality=80');
