INSERT INTO `chouti` VALUES ('942', '【AI不能“取代”医生给我们看病，这并不是因为AI不够强大】机器学习为内核的算法并非一个逻辑确定的系统，里面涵盖了上千个互相牵涉的指标，也会根据训练数据的不同产生不同的效果，究竟是否存在确凿无疑、让人百分百信服的因果联系，很难说清。而治病救人的医学，恰恰最需要稳定且可重复的证据支撑。', '\n-在人工智能计算能力大幅提升的今天，乐观派们认为AI接管医院只是时间问题，然而从实验室到医院的这段路，依然困难重重……\n', '27', '23', '果壳', '1天22小时前', 'https://www.guokr.com/article/446000/', 'https://img3.chouti.com/CHOUTI_20190406/1D62245F3BC344818FC4EAA74E6F0AB9_W480H480=C120x120.jpg?quality=80');
