INSERT INTO `chouti` VALUES ('984', '【你的咖啡机是冲咖啡用的，人家瑞幸的咖啡机是杠杆】根据多名在此前几轮融资中先后接触过瑞幸咖啡的投资人表示，他们最终决定不参与投资的原因，都是因为担心瑞幸的现金流，因为他们按照瑞幸的成本和收入数据，“怎么算都算不对”，看不到盈利的可能。现金流的问题也注定会是上市前各种路演中被关注的焦点。', '\n你的咖啡机是冲咖啡用的，人家瑞幸的咖啡机是杠杆\n', '33', '31', 'PingWest', '2天8小时前', 'https://www.pingwest.com/a/185852', 'https://img3.chouti.com/CHOUTI_20190405/A4B7DA34EB2C4A52B9F007F06F6B26ED_W480H480=C120x120.jpg?quality=80');
