INSERT INTO `chouti` VALUES ('987', '【是地球人先开的火！！】日本探测器“隼鸟2号”5日成功在小行星“龙宫”表面制造陨石坑，这是全球首次利用“撞击器”发射金属弹，再现实际天体碰撞陨石坑的过程。在尘埃和碎片物散去后，“隼鸟2号”将采集“龙宫”地底下的岩石样本，科学家们希望这些样本能帮助他们揭示更多有关太阳系和地球生命起源的信息。', '暂无', '25', '5', 'Cog', '2天11小时前', 'https://mp.weixin.qq.com/s/RAtPBoCZdJbFefCXO2Zhxg', 'https://img3.chouti.com/CHOUTI_20190405/F5CD3081445E4407856B63F6E5ECEA86_W259H259=C120x120.jpg?quality=80');
