INSERT INTO `chouti` VALUES ('1006', '【护士临终忏悔：我调换了五千名婴儿】身患癌症的前护士Elizabeth Mwewa日前声称自己在赞比亚大学教学医院工作的12年间，调换了近5000名新生儿。起初是为好玩，后来成了习惯。得绝症后为寻求上帝宽恕，才把这事说了出来。她说1983-1995年在他们医院出生的人要注意，他们跟父母可能没血缘关系。', '暂无', '21', '57', 'ginobili兔紫', '1小时4分钟前', 'http://dig.chouti.com/pic/show?nid=6bd6c026d6d0fd4bdfebffc95ccd7a2b&lid=25544936', 'https://img3.chouti.com/CHOUTI_20190408/430F04305876470C877C29E1AFF41F98_W200H200=C120x120.png?quality=80');
