INSERT INTO `chouti` VALUES ('1008', '【一家三口楼道捡到不明物品拆解时爆炸，物主被拘留】3月31日，受害一家三口正准备出门，因为没带车钥匙、房门钥匙，3人返回家门口，在23楼电梯间等待着开锁师傅间隙，8岁女儿在没有住户的邻居家门口发现了一用胶带缠紧的物体，出于好奇父亲用火机点燃了胶带，这时包裹发生了爆炸。', '暂无', '31', '62', '网易国内', '1小时24分钟前', 'https://news.163.com/19/0407/18/EC6BHEMF0001899N.html', 'https://img3.chouti.com/img_1554636391726=C120x120.jpg?quality=80');
INSERT INTO `chouti` VALUES ('1009', '【《经济学人》：全世界的豪宅价格都在跌？】前不久“太平山顶”的一块空地开始招标，结果当地开发商的出价均未能达到政府的底价，令所有人大跌眼镜。去年，曼哈顿房价下跌了4.3%；据在线房产搜索公司StreetEasy统计，2018年售价为100万美元及以上的房屋有60%未能出售。在悉尼，黄金地段的房价从2017年起已经下滑了16%。', '暂无', '10', '7', '钛媒体', '1小时34分钟前', 'http://www.tmtpost.com/3869109.html', 'https://img3.chouti.com/img_1554689735566=C120x120.jpg?quality=80');
INSERT INTO `chouti` VALUES ('1010', '以色列国防部发推暗示“伊朗妇女孕育恐怖分子”，网友骂翻', '\n以色列国防部发推暗示“伊朗妇女孕育恐怖分子”，网友骂翻\n', '19', '13', '观察者', '1小时44分钟前', 'https://www.guancha.cn/internation/2019_04_08_496752.shtml', 'https://img3.chouti.com/img_1554704021259=C120x120.jpg?quality=80');
INSERT INTO `chouti` VALUES ('1011', '【为“二战大军”建立“考研村”，「知悟科技」获千万元 A 轮融资】考研市场从 2015 年开始保持每年 10% 的人数增长。今年研究生报考人数达 285 万，比去年增长了 21%，再创历史新高。据创始人透露，仅杭州一个考研村基地，在 2018 年就贡献了 2000 万营收，净利在 20% 左右。', '暂无', '9', '2', '36氪', '1小时54分钟前', 'http://36kr.com/p/5192313.html?ktm_source=feed', 'https://img3.chouti.com/CHOUTI_20190408/3484BC87120F4F03AEBBB22E96E80E58_W672H672=C120x120.jpg?quality=80');
INSERT INTO `chouti` VALUES ('1012', '如果说时尚是一场冒险，那么深圳时装周就是死亡的终点……', '暂无', '40', '42', '肉粽酿米酒', '2小时4分钟前', 'https://mp.weixin.qq.com/s/LYF7osJL4AG_CFBws1w9BA', 'https://img3.chouti.com/CHOUTI_20190408/6A1F172A74A54BC1A72289F420E1A258_W537H537=C120x120.jpg?quality=80');
INSERT INTO `chouti` VALUES ('1013', '【不要两手空空走进星巴克，要带上你的工作】星巴克的成本结构中，咖啡等原材料的成本占比13%，约4元。但通过“第三空间”和品牌所赋予的溢价，一杯星巴克卖到了36甚至更高的价位。“很多人，上班的时候在这里，下班的时候也在这里。他们在干嘛呢？用电脑上网，与客户谈生意。”星巴克的中国顾客很清楚自己在为什么付费。', '暂无', '15', '25', '界面', '2小时14分钟前', 'https://www.jiemian.com/article/3003767.html', 'https://img3.chouti.com/CHOUTI_20190408/613867924B59442BA09AE095C1DF3E23_W519H519=C120x120.jpg?quality=80');
INSERT INTO `chouti` VALUES ('1014', '前斯托克城球员舒波莫廷在昨晚巴黎vs斯特拉斯堡比赛中的经典射门……【Worst miss of all time？ - It has to be！】', '暂无', '17', '23', 'ryan11', '2小时24分钟前', 'https://weibo.com/tv/v/HoEBC7iKO?fid=1034:4358758680493614', 'https://img3.chouti.com/CHOUTI_20190408/88AA46CDF3B341CBA5146C4E19F0268B_W480H480=C120x120.jpg?quality=80');
INSERT INTO `chouti` VALUES ('1015', '赵又廷官宣了！高圆圆怀孕了', '暂无', '30', '58', 'xiaopendvd', '2小时30分钟前', 'http://dig.chouti.com/pic/show?nid=0595455bd4eb4f34c7e4d8aee680c118&lid=25543456', 'https://img3.chouti.com/CHOUTI_20190408/A79D063112AD496BA45FFFC439FE21AF_W200H200=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('1016', '农民工造飞机在快手就我所知至少有三四个团队，都是静态模型，飞机基本是双发中型客机，比如A320或者B737。他们的商业模式也很清晰，做好的飞机有的会建成餐厅。我最忘不了的一个夭折的飞机计划，建到一半出个视频说：“团队拆伙，他们把翅膀带走了…” 画面里一辆农用车拉着一副机翼在乡村土路上绝尘而去…', '暂无', '23', '8', 'royalflame', '2小时36分钟前', 'https://weibo.com/1573046985/HoEVZ4cNu', 'https://img3.chouti.com/CHOUTI_20190408/92AC12C6CFD84DD89E0418BE64824473_W200H200=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('1017', '央视春晚开创者、首届春晚总导演黄一鹤去世，享年85岁', '\n据悉，4月8日清晨，央视春晚开创者、首届春晚总导演黄一鹤先生去世，享年85岁。先后担任五届央视《春节联欢晚会》导演。\n', '18', '6', '巴颜格日顺', '2小时42分钟前', 'https://www.thepaper.cn/newsDetail_forward_3271945', 'https://img3.chouti.com/CHOUTI_20190408/DEB98696F0714408AB4F0B626B0F7ECE_W200H200=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('1018', '【世界第6联赛，价值80亿的中超，为何连片草地都整不好？】​​“我们不怕河南队（建业），我们怕的就是他们的场地。就那个草皮，驴上去跑都能崴脚！”2019赛季中超联赛第4轮，武汉卓尔与河南建业的比赛本应在武汉五环体育中心如期打响，但因场地不合格造成比赛延期，这在中超历史上还是头一回。', '暂无', '25', '21', '善良之枪', '2小时48分钟前', 'http://sports.163.com/19/0408/07/EC7LE6RF00058780.html', 'https://img3.chouti.com/CHOUTI_20190408/950CA83319F04628908ED58DBC8FCF3B_W361H361=C120x120.jpeg?quality=80');
INSERT INTO `chouti` VALUES ('1019', '防盗密码伞', '暂无', '34', '36', '没品图', '2小时54分钟前', 'http://video.weibo.com/show?fid=1034:4358786966591163', 'https://img3.chouti.com/CHOUTI_20190408/4CC612155EAC4A97A1E9203E7F560825_W480H480=C120x120.jpg?quality=80');
INSERT INTO `chouti` VALUES ('1020', '【我看了三万条喝水视频，走进了“喝水族”的正能量世界】喝水族是一个神奇的 YouTube 群体，他们什么都不做，只喝水。喝水族的视频基本都在一分钟以内。大部分的频道都是他们对着摄像头，端起杯子喝水或者拧开矿泉水瓶盖灌水，仅此而已。有些频道的喝水视频数量甚至数以千计。', '暂无', '11', '6', 'VICE中国', '2小时59分钟前', 'http://www.vice.cn/read/inside-the-positive-community-of-competitive-youtube-water-drinkers', 'https://img3.chouti.com/CHOUTI_20190408/BC5E7FF753C14672BF3EF638851D2436_W800H800.jpg.1600x900=C120x120.jpg?quality=80');
INSERT INTO `chouti` VALUES ('1021', '总裁班、农村老人和他的儒学教育', '\n孔为峰今年五十岁，是孔子的七十六代后人。在曲阜，孔子的后代有十几万人，姓孔并不特殊。但是，2003年，孔为峰在曲阜办了首个读经班，他说，只要想学习孔子的市民都可以免费听他的课。在曲阜，他是推广孔子的一个代表。\n', '14', '5', '界面', '3小时6分钟前', 'https://www.jiemian.com/article/3020850.html', 'https://img3.chouti.com/CHOUTI_20190408/1B1082FC2E964985B401AFA3B343A91C_W200H200=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('1022', '【中国枪神诞生记】1999年，16岁的孟阳看到了那期改变一生的报纸。亲眼看到《CBI游戏天地》头版写着“电脑游戏大奖赛”，孟阳才坚定了走电竞这条路。5年后，孟阳在长城赢下100万元奖金，一夜之间成为轰动游戏圈的人物。比起真名，孟阳的游戏ID——RocketBoy，在当时更为玩家所熟知。', '暂无', '32', '25', '瑞兽幼崽', '3小时12分钟前', 'http://www.yystv.cn/p/4884', 'https://img3.chouti.com/CHOUTI_20190408/1503629B29CB4453AB0A621245355687_W200H200=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('1023', '【共享单车涨价求生】以单车寿命三年，残值150元计算，摩拜单车折旧成本在550元一年；而按一年使用300天，一天4次，一次1元的使用状况计算，一年收入则达1200元；加上摩拜投资人披露的每辆每天0.6元、一年180元的预计运营成本，理论情况下，摩拜盈利似乎不成问题。', '暂无', '18', '25', '璀璨的摧残', '3小时18分钟前', 'https://news.caijingmobile.com/article/detail/387284?source_id=40', 'https://img3.chouti.com/CHOUTI_20190408/D869353601114AE4ADA3563E7F3896E6_W200H200=C120x120.png?quality=80');
INSERT INTO `chouti` VALUES ('1024', '路过一家新开的早餐店，打望来着，老板看见我，客气地招呼：「来啦？今天吃点什么？」自来熟，好像我天天来似的。但是我脸皮薄，话都说到这份上了，只好进店坐下，然后告诉殷勤的老板：「老样子！」能看到一丝慌张掠过了老板的脸，但他还是强撑着没有问，而是忐忑地给我端来了最普通的一屉肉包一碗粥。', '暂无', '69', '26', '肉粽酿米酒', '3小时24分钟前', 'https://www.douban.com/people/heybye/status/2455448987/', 'https://img3.chouti.com/CHOUTI_20190408/1D1DC15E5E0C406B8BD98F27FDB5C100_W426H426=C120x120.jpeg?quality=80');
